// This file is automatically compiled by Webpack, along with any other files
// present in this directory. You're encouraged to place your actual application logic in
// a relevant structure within app/javascript and only use these pack files to reference
// that code so it'll be compiled.

require("@rails/ujs").start();
require("turbolinks").start();
require("@rails/activestorage").start();
require("channels");
// require("@angular");


require("jquery");
require("bootstrap");
require("bootstrap-datepicker/js/bootstrap-datepicker");
require("bootstrap-select");
require("javascripts/scripts.bundle");
require("javascripts/tooltip");
require("@fortawesome/fontawesome-free/js/all");
// require('@client-side-validations/client-side-validations');


//Component nested_forms

require("@nathanvda/cocoon");


require("packs/general");
require("packs/users");
require("packs/permissions");
require("packs/notifications");
require("packs/home");
require("packs/request_steps");
require("packs/companies.js");
require("packs/balance_concepts");


// Components with react
require("components/logbook_index");
require("components/role_permissions");

// Uncomment to copy all static images under ../images to the output folder and reference
// them with the image_pack_tag helper in views (e.g <%= image_pack_tag 'rails.png' %>)
// or the `imagePath` JavaScript helper below.
//
require.context('../../assets/images', true);
// const imagePath = (name) => images(name, true)
// Support component names relative to this directory:
var componentRequireContext = require.context("components", true);
var ReactRailsUJS = require("react_ujs");
ReactRailsUJS.useContext(componentRequireContext);
